import React from "react";

export default function ViewTodo({ data ,dispatch}) {
  // console.log(data,'koky')
  return (
    <div>
      {data.map((todo) => {
        return (
          <ul>
            <li> {todo.name}</li>
            <li><button></button></li>
          </ul>
        );
      })}
    </div>
  );
}
